drop table if exists "image" cascade;
create table if not exists "image"
(
    id         uuid primary key,
    file_name  text,
    file       bytea,
    created_at timestamp,
    updated_at timestamp
);

drop table if exists "type" cascade;
create table if not exists "type"
(
    id         uuid primary key,
    name       text,
    created_at timestamp,
    updated_at timestamp
);

drop table if exists "classification" cascade;
create table if not exists "classification"
(
    id         uuid primary key,
    type_id    uuid,
    image_id   uuid,
    result     text,
    created_at timestamp,
    updated_at timestamp,
    constraint fk_classification_type_id_type_id foreign key (type_id) references "type" (id) on update cascade on delete cascade,
    constraint fk_classification_image_id_image_id foreign key (image_id) references "image" (id) on update cascade on delete cascade
);

